import React from 'react';
import './Home.css';
function Home({title, imageUrl, body}){
    return (
        <div className='card-container'>
            <div className="image-container">
                <img src={imageUrl} alt=''/>
              
            </div>
            <div className="card-title">
                <h3>{title}</h3>
            </div>
            <div className="card-body">
                <p>{body}</p>
            </div>
            <div className="btn">
                <button>
                    <a>View more</a>
                </button>
            </div>
            
        </div>

    )
}

export default Home;
